const About = () => {
  return (
    // ... keep all existing structure and styling ...
    <div className="about-text">
      <p>
        I'm a <strong>Cloud Solutions Engineer</strong> with experience in deploying AI/LLM applications through AWS and Google Cloud. My technical background in DevOps and military leadership gives me a unique ability to bridge complex technologies with business needs.
      </p>
      <p>
        At ERA Solutions, I worked with AWS/GCP infrastructure while gaining exposure to client-facing technical sales. I've implemented solutions using modern AI tools like LLMs where appropriate, always focusing on measurable business impact.
      </p>
      <p>
        My U.S. Army experience managing $2M+ in mission-critical systems taught me how to optimize processes, lead teams under pressure, and communicate complex information clearly - skills that directly translate to technical sales.
      </p>
      <p>
        Currently expanding my expertise in generative AI applications through hands-on projects and coursework, while maintaining certifications in AWS and Google Cloud.
      </p>
    </div>
  );
};
